import React from "react";
import TableMUI from "./components/TableMUI";
import Header from "./components/Header";

// In order to use the React Router DOM we wrap the whole thing inside the BrowserRouter component..
// Which we get from "react-route-dom" module

function App() {
  return (
    <div className="App">

    <Header />

      <div>
        <ul>
          <li>Home</li>
          <li>Details</li>
        </ul>
      </div>

    <TableMUI />

    </div>
  );
}

export default App;
